The current definition of an input is pub struct TransactionInput { /// The features of the output being spent. We will check maturity for all outputs. pub features: OutputFeatures, /// The commitment referencing the output being spent. pub commitment: Commitment,
} In standard Mimblewimble, an input is the same as an output sans range proof. The range proof doesn't need to be checked again when spending inputs, so it is dropped. The updated input definition is: pub struct TransactionInput { /// Options for an output's structure or use features: OutputFeatures, /// The homomorphic Pedersen commitment representing the output amount commitment: Commitment, /// The serialised script script: Vec<u8>, /// The script input data, if any input_data: Vec<u8>, /// Signature signing the script, input data, [script public key] and the homomorphic commitment with a combination /// of the homomorphic commitment private values (amount and blinding factor) and the [script private key]. script_signature: CommitmentSignature, /// The sender offset pubkey, K_O sender_offset_public_key: PublicKey
} The script_signature is an aggregated Commitment Signature signed with a combination of the homomorphic commitment private values \( (v_i \, , \, k_i )\) and script private key \(k_{Si}\) to prove ownership thereof. It signs the script, the script input, script public key and the commitment: $$ \begin{aligned} s_{Si} = (a_{Si}, b_{Si}, R_{Si} ) \end{aligned} \tag{13} $$ Where $$ \begin{aligned} R_{Si} &= r_{Si_a} \cdot H + r_{Si_b} \cdot G \\ a_{Si} &= r_{Si_a} + e(v_{i}) \\ b_{Si} &= r_{Si_b} + e(k_{Si}+k_i) \\ e &= \hash{ R_{Si} \cat \alpha_i \cat \input_i \cat K_{Si} \cat C_i} \\ \end{aligned} \tag{14} $$ This is verified by the following: $$ \begin{aligned} a_{Si} \cdot H + b_{Si} \cdot G = R_{Si} + (C_i+K_{Si})e \end{aligned} \tag{15} $$ The script public key \(K_{Si}\) needed for the script signature verification is not stored with the TransactionInput, but obtained by executing the script with the provided input data. Because this signature is signed with the script private key \(k_{Si}\), it ensures that only the owner can provide the input data \(\input_i\) to the TransactionInput.

